import React, { Component } from 'react';
import './Header.css';
import Icon from './symitems.png'

class Header extends Component {

  render() {
    return (
      <div className="icon-background"><img src={Icon}  alt="アイコン" /><h1>共通ヘッダだよ</h1></div>
    );
  }
}

export default Header;
